import dynamic from "next/dynamic"
import { useState } from 'react'


const Rust = dynamic({
  loader: async () => {
    const rust = await import('../pkg')

    return (
      (props) => {
        const [board, setBoard] = useState([])

        return (
          <>
            <input onChange={e => setBoard(e.target.value)} />
            <div>{rust.best(Uint32Array.from(board))}</div>
          </>
        )
      })
  },
})

export default Rust
